const user = {
  id: 1124,
  name: 'Morgrace Precious',
  image: 'https://i.pravatar.cc/48?u=1124',
};
const imageSlide = [
  '../../public/img/trophy-1.jpg',
  '../../public/img/trophy-2.jpg',
  '../../public/img/trophy-3.jpg',
];
const Header = function () {
  return (
    <header>
      <UserAccount />
      <DiamondToken />
      <Carousel />
    </header>
  );
};
const UserAccount = function () {
  return (
    <div>
      <img src={`${user['image']}`} alt="profile pix" />
      <div>
        <span>{user['name']}</span>
        <span>ID-{user['id']}</span>
      </div>
    </div>
  );
};
const DiamondToken = function () {
  return <div>160</div>;
};
const Carousel = function () {
  return (
    <div className=" w-full h-[20vh] bg-cover bg-center bg-no-repeat bg-(image:--bg-header) !p-[1rem_2rem] grid">
      <div className="text-[var(--offwhite)] w-1/2 grid">
        <h1 className="text-[1.4rem] font-semibold">
          Test Your Knowledge with Quizzes
        </h1>
        <p className="font-semibold text-[0.6rem]">
          You're just looking for a playful way to learn new facts, our quizzes
          are designed to entertain and educate.
        </p>
        <button className="font-semibold text-[1rem] text-[#094298]">
          Play Now
        </button>
      </div>
    </div>
  );
};
export default Header;
